import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <header>
    <nav>
      <Link to="/">
        <h1 className="title">
          Bookstore CMS
        </h1></Link>
    </nav>
  </header>
);

export default Navbar;
